import React, {Fragment} from 'react';
import styled from 'styled-components';


const audioPlayer = () => (
	<Fragment>
		<audio>
		<source src="track.mp3" type="audio/mpeg" />
		</audio>
	</Fragment>
)

export default audioPlayer;
